import Signup from './pages/signUp/signup';
import Login from './pages/login/login';

function App() {
  return (
    <Router>
      <div>
        <Route exact path="/">
          <Redirect to="/signup" />
        </Route>
        <Route path="/signup" component={Signup} />
        <Route path="/login" component={Login} />
      </div>
    </Router>
  );
};
export default App;
